      {/* <ColorModeScript initialColorMode={theme.config.initialColorMode} /> */}
      {/* <ColorModeSwitcher justifySelf="flex-end" /> */}
      <Home />
    </ChakraBaseProvider>
  </React.StrictMode>,
)

